import { useParams } from "react-router-dom";

const Details = () => {
  const { title } = useParams();

  return (
    <div className="details">
      <h2>Details for {title}</h2>
      <textarea rows="6" cols="50" placeholder="Enter text here..." />
    </div>
  );
};

export default Details;
